import React, { useState } from 'react';
import '../MCQPage.css'; // Create a separate CSS file for styling if needed

const MCQPage = () => {
  const [questions, setQuestions] = useState([]);
  const [error, setError] = useState(null);
  const [numQuestions, setNumQuestions] = useState('');
  const [subject, setSubject] = useState('');
  const [selectedOptions, setSelectedOptions] = useState({});
  const [feedbacks, setFeedbacks] = useState({});

  const handleResponse = (data) => {
    const formattedQuestions = Object.values(data).map(q => ({
      question: q.mcq,
      options: Object.entries(q.options).map(([key, value]) => ({
        key,
        value
      })),
      correct: q.correct
    }));
    setQuestions(formattedQuestions);
  };

  const handleFetchQuestion = () => {
    fetch('http://127.0.0.1:5000/question', {
      method: "POST",
      headers: {
        'Content-type': 'application/json',
      },
      body: JSON.stringify({
        numQuestions,
        subject,
      }),
    })
      .then(response => {
        if (!response.ok) {
          throw new Error("network response not ok");
        }
        return response.json();
      })
      .then(data => {
        handleResponse(data);
      })
      .catch(error => {
        setError(error.message);
        console.log("Error fetching question: ", error);
      });
  };

  const handleOptionClick = (questionIndex, optionKey, correctAnswer) => {
    setSelectedOptions(prev => ({
      ...prev,
      [questionIndex]: optionKey
    }));

    setFeedbacks(prev => ({
      ...prev,
      [questionIndex]: optionKey === correctAnswer ? "Correct!" : "It is not correct!"
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Answers Submitted:", selectedOptions);
  };

  return (
    <form className="mcq-form" onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="numQuestions">Number of Questions:</label>
        <input
          type="text"
          id="numQuestions"
          value={numQuestions}
          onChange={(e) => setNumQuestions(e.target.value)}
          placeholder='Enter number of questions'
          className="input-field"
        />
      </div>
      <div className="form-group">
        <label htmlFor="subject">Subject:</label>
        <input
          type="text"
          id="subject"
          value={subject}
          onChange={(e) => setSubject(e.target.value)}
          placeholder='Enter subject of questions'
          className="input-field"
        />
      </div>
      <button type="button" onClick={handleFetchQuestion} className="fetch-btn">Fetch Questions</button>

      {error && <p className="error">Error: {error}</p>}

      {questions.length === 0 ? (
        <p>Loading questions...</p>
      ) : (
        <div className="questions-container">
          {questions.map((q, index) => (
            <div key={index} className="question-block">
              <h3>{index + 1}) {q.question}</h3>
              <div className="options-container">
                {q.options.map(option => (
                  <label key={option.key} className="option-label">
                    <input
                      type="radio"
                      name={`question-${index}`}
                      value={option.key}
                      onClick={() => handleOptionClick(index, option.key, q.correct)}
                      className="option-input"
                    />
                    {option.value}
                  </label>
                ))}
              </div>
              {selectedOptions[index] && (
                <p className="feedback">Feedback: {feedbacks[index]}</p>
              )}
            </div>
          ))}
        </div>
      )}
      <button type="submit" className="submit-btn">Submit Answers</button>
    </form>
  );
};

export default MCQPage;
